import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import { motion } from 'framer-motion';
import { FiTrash2, FiEdit, FiEye } from 'react-icons/fi';

const MyQuizzes = () => {
  const [quizzes, setQuizzes] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [deleting, setDeleting] = useState(null);

  useEffect(() => {
    fetchMyQuizzes();
  }, []);

  const fetchMyQuizzes = async () => {
    setLoading(true);
    try {
      const res = await axios.get('/api/user/quizzes');
      setQuizzes(res.data);
      setError('');
    } catch (err) {
      setError('Błąd podczas pobierania quizów.');
    }
    setLoading(false);
  };

  const handleDelete = async (quizId) => {
    if (!window.confirm('Czy na pewno chcesz usunąć ten quiz? Tej operacji nie można cofnąć.')) {
      return;
    }

    setDeleting(quizId);
    try {
      await axios.delete(`/api/quizzes/${quizId}`);
      setQuizzes(quizzes.filter(q => q.id !== quizId));
    } catch (err) {
      alert(err.response?.data?.error || 'Błąd podczas usuwania quizu.');
    }
    setDeleting(null);
  };

  return (
    <motion.div className="container fade-in" initial={{ opacity: 0 }} animate={{ opacity: 1 }}>
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', margin: '32px 0 24px 0' }}>
        <h2>Moje Quizy</h2>
        <Link to="/create-quiz" className="btn btn-primary">
          Utwórz nowy quiz
        </Link>
      </div>
      
      {loading ? (
        <div>Ładowanie quizów...</div>
      ) : error ? (
        <div style={{ color: 'red' }}>{error}</div>
      ) : quizzes.length === 0 ? (
        <div className="card" style={{ textAlign: 'center', padding: '40px' }}>
          <h3>Nie masz jeszcze żadnych quizów</h3>
          <p style={{ marginBottom: '20px' }}>Utwórz swój pierwszy quiz i udostępnij go innym!</p>
          <Link to="/create-quiz" className="btn btn-primary">
            Utwórz pierwszy quiz
          </Link>
        </div>
      ) : (
        <div style={{ display: 'flex', flexWrap: 'wrap', gap: 24, justifyContent: 'center' }}>
          {quizzes.map(quiz => (
            <motion.div
              className="card fade-in"
              key={quiz.id}
              whileHover={{ scale: 1.02 }}
              style={{ minWidth: 300, maxWidth: 400 }}
            >
              <h3 style={{ marginBottom: 8 }}>{quiz.title}</h3>
              <div style={{ color: '#764ba2', fontWeight: 500, marginBottom: 8 }}>{quiz.category}</div>
              <div style={{ marginBottom: 8 }}>{quiz.description}</div>
              <div style={{ fontSize: 14, color: '#888', marginBottom: 8 }}>
                Pytania: {quiz.questionCount} | Poziom: {quiz.difficulty} | Język: {quiz.language}
              </div>
              <div style={{ fontSize: 14, color: '#888', marginBottom: 16 }}>
                Utworzono: {new Date(quiz.createdAt).toLocaleDateString()}
              </div>
              
              <div style={{ display: 'flex', gap: 8, flexWrap: 'wrap' }}>
                <Link to={`/quizzes/${quiz.id}`} className="btn btn-secondary" style={{ flex: 1, display: 'flex', alignItems: 'center', justifyContent: 'center', gap: 6 }}>
                  <FiEye />
                  Podgląd
                </Link>
                <button 
                  className="btn btn-danger" 
                  onClick={() => handleDelete(quiz.id)}
                  disabled={deleting === quiz.id}
                  style={{ display: 'flex', alignItems: 'center', gap: 6 }}
                >
                  <FiTrash2 />
                  {deleting === quiz.id ? 'Usuwanie...' : 'Usuń'}
                </button>
              </div>
            </motion.div>
          ))}
        </div>
      )}
    </motion.div>
  );
};

export default MyQuizzes;
